function ProfileCard({name, description, instagram, instagram_url}) {
  return (
    <div className="profilecard">
      <p>{name}{description}</p>
      <p>instaIcon <a target="_blank" rel="noreferrer" href={instagram_url}>{instagram}</a></p>
    </div>
  );
}

export default ProfileCard;
